void multiCalculate(char c) {
	if (c == '(') {
		cStack.push(c);
	}
	else if(isOperate(c)) {
		if (!cStack.empty()) {
			//
			if (isOp2(cStack.top()) ||
				isOp1(cStack.top()) && isOp1(c)) {
				simpleCalculate();
			}
		}

		if (!cStack.empty()) {
			//
			if (isOp2(cStack.top()) ||
				isOp1(cStack.top()) && isOp1(c)) {
				simpleCalculate();
			}
		}

		//
		cStack.push(c);
	}
	else if(c==')') {
		simpleCalculate();
		//
		simpleCalculate();

		if (!cStack.empty() && cStack.top() == '(') {
			//)
			cStack.pop();
			return;
		}
	}

	return;
}


void simpleCalculate() {
	if (nStack.size() >= 2 && cStack.size() >= 1 && isOperate(cStack.top())) {
		char c = cStack.top();
		cStack.pop();
		double n2 = nStack.top();
		nStack.pop();
		double n1 = nStack.top();
		nStack.pop();
		nStack.push(calculate(n1, n2, c));
	}
	return;
}

double calculate(double n1, double n2, char o) {
	switch (o)
	{
	case '+':
		return n1 + n2;
	case '-':
		return n1 - n2;
	case '*':
		return n1 * n2;
	case '/':
		if (n2 == 0)
			throw "0";
		return n1 / n2;
	default:
		break;
	}
}

bool isNum(char c) {
	return (c >= '0' && c <= '9');
}

bool isOperate(char c) {
	return isOp1(c) || isOp2(c);
}

bool isOp1(char c) {
	return c == '+' ||
		c == '-';
}

bool isOp2(char c) {
	return c == '*' ||
		c == '/';
}

//[0-9+-*/()]
bool checktwochar(char c1, char c2) {
	//12,1+,2)
	if (isNum(c1))
		return isNum(c2) || isOperate(c2) || c2==')';
	//(+1,+(
	if (isOperate(c1))
		return isNum(c2) || c2 == '(';
	//(((8,((
	if (c1 == '(')
		return isNum(c2) || c2=='(';
	//)))-,))
	return isOperate(c2) || c2==')';
}


bool checkchar(char c){
	if (isNum(c) || 
		isOperate(c) ||
		c == '(' ||
		c == ')')
		return true;
	return false;
}



